import React from 'react';

const EnterButton = ({ onClick }) => {
  return (
    <button onClick={onClick} style={{ padding: '10px 20px', fontSize: '16px', marginTop: '10px' }}>
      Enter
    </button>
  );
};

export default EnterButton;
